import { FunctionComponent, useState } from 'react';
import '../../css/styleM.scss';

import Asset000 from '../../../../shared/images/assets/elysia-asset00.png';
import Asset001 from '../../../../shared/images/assets/elysia-asset01.png';


interface Props {
  TokenName: string;
  Image: string;
  MarketSize?: number;
  TotalBorrowed?: number;
  DepositApy?: number;
  BorrowApr?: number
}

const TableListItem: FunctionComponent<Props> = (props: Props) => {
  return (
    <>
      <tr>
        <th>
          <div style={{ justifyContent: 'left', gap: 10 }}>
            <img src={Asset000} alt="ETH" />
            <p>ETH</p>
          </div>
        </th>
        <th>
          -
        </th>
        <th>
          -
        </th>
        <th>
          -
        </th>
        <th>
          -
        </th>
        <th>
          <div className="tokens__table-body-button">
            <p>Deposit</p>
          </div>
        </th>
        <th>
          <div className="tokens__table-body-button">
            <p>Borrow</p>
          </div>
        </th>
      </tr>
    </>
  );
}


export default TableListItem;
